import React from "react";
import CardHeader from "react-bootstrap/esm/CardHeader";

function About() {
    return (
        <Card>
            <header className="App-header">
                <h1>What is HvZ?</h1>
            </header>
            <a>
                Hello! this is the about page!
            </a>
        </Card>
    );
}

export default About;
